import React, { useEffect, useState } from "react";
import "./All.css"


const Home = () =>{

    const [fırsatListe,setFırsatListe] = useState([])

    const film_img="https://www.cheapshark.com"

    useEffect(() =>{
        const api_link="https://www.cheapshark.com/api/1.0/stores"
        fetch(api_link)
        .then(fl=>fl.json())
        .then(fl=>{
            setFırsatListe(fl)
        })
    },[])

    return(
        <div className="container col-12 row row-cols-2 row-cols-md-6 g-4">
            {
                fırsatListe.map(fl=>
                    <div>
                        <img src={film_img + fl.images.logo} width="180px" />
                    </div>
                    )
            }

        </div>
    )
}

export default Home;
